import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./pages/Home";
import News from "./pages/News";

function App() {
  return (
    <Router>
      <Home />
      <Routes>
        <Route path="/news" component={News} />
      </Routes>
    </Router>
  );
}

export default App;
